import React from "react";

function List(){
    return(
        <div>
            <table>
                <th> Nom Complet </th>
                <th> Email </th>
                <th> Contact </th>
                <th> Adresse </th> 
            </table>
            <tbody>
                <td> Nom Complet </td>
                <td> Email </td>
                <td> Contact </td>
                <td> Adresse </td>  
            </tbody>
        </div>
    )
}

export default List;
